import React from "react";
import { Link } from "react-router-dom";

import ImageControls from "../ImageControls/image-controls.components";
import LazyImage from "../LazyImage/lazy-image.component";

import { copyToClipboard } from "../../utils/index";

// cyanClick = (el) => {
//   console.log("cyan click");
//   console.log(el);
// };

const ImageItem = (element) => (
  <div className="relative">
    <LazyImage {...element} />
    <Link to={`/image/${element.id}`}>
      <ImageControls element={element} copyHandler={copyToClipboard} />
    </Link>
  </div>
);

export default ImageItem;
